def partition(arr, start, end):
    pivot_elem = arr[start]

    low = start + 1
    high = end

    while True:
        while low <= high and arr[high] >= pivot_elem:
            high  = high -1
        
        while low <= high and arr[low] <= pivot_elem:
            low = low + 1
        
        if low <= high:
            arr[low], arr[high] = arr[high], arr[low]
        else:
            break
    arr[start], arr[high] = arr[high], arr[start]

    return high

def quick_sort(arr, start, end):
    if start >=  end:
        return
    
    p = partition(arr, start, end)
    quick_sort(arr, start, p - 1)
    quick_sort(arr, p+1, end)


def binary_search(arr, start, end, elem):
    if end >= start:
        mid = (end + start) // 2
        if arr[mid] == elem:
            return mid
        elif arr[mid] > elem:
            return binary_search(arr, start, mid - 1, elem)
        else:
            return binary_search(arr, mid + 1, end, elem)
    else:
        return -1


